#!/bin/bash

# OpticRingGenerator macOS Installer
# This installer contains the embedded binary

set -e

APP_NAME="OpticRingGenerator"
INSTALL_DIR="/usr/local/bin"
BINARY_NAME="optics-ring-generator"

echo "üöÄ Installing $APP_NAME..."

# Check if running as root for system-wide installation
if [[ $EUID -ne 0 ]]; then
    echo "‚ö†Ô∏è  Not running as root. Installing to ~/bin instead of /usr/local/bin"
    INSTALL_DIR="$HOME/bin"
    mkdir -p "$INSTALL_DIR"
fi

# Decode and install binary
echo "üì¶ Extracting binary..."
cat << 'BINARY_EOF' | base64 -d > "$INSTALL_DIR/$BINARY_NAME"

BINARY_EOF

# Make executable
chmod +x "$INSTALL_DIR/$BINARY_NAME"

# Add to PATH if installing to ~/bin
if [[ "$INSTALL_DIR" == "$HOME/bin" ]]; then
    if [[ ":$PATH:" != *":$HOME/bin:"* ]]; then
        echo "üìù Adding $HOME/bin to PATH in ~/.zshrc"
        echo 'export PATH="$HOME/bin:$PATH"' >> ~/.zshrc
        echo "‚ÑπÔ∏è  Please run 'source ~/.zshrc' or restart your terminal"
    fi
fi

echo "‚úÖ $APP_NAME installed successfully!"
echo "üöÄ You can now run: $BINARY_NAME"
echo ""
echo "üìã Usage examples:"
echo "   $BINARY_NAME --help"
echo "   $BINARY_NAME CX --diameter 25.0 --thickness 3.0"
echo "   $BINARY_NAME --interactive"
echo ""
